function createGeneCountObj(geneStr) {
  let resultObj = { A: 0, C: 0, G: 0, T: 0 };
  for (let i = 0; i < geneStr.length; i++) {
    resultObj[geneStr[i]]++;
  }
  return resultObj;
}

function generateGeneCorrectinStrSubSequence(obj, n) {
  const geneCorrection_SubSequence = {
    subSequenceStr: "",
    correctionStr: "",
  };
  for (const key in obj) {
    obj[key] = obj[key] - n / 4;
    if (obj[key] > 0) {
      geneCorrection_SubSequence.subSequenceStr =
        geneCorrection_SubSequence.subSequenceStr + key.repeat(obj[key]);
    } else {
      geneCorrection_SubSequence.correctionStr =
        geneCorrection_SubSequence.correctionStr +
        key.repeat(Math.abs(obj[key]));
    }
  }
  return geneCorrection_SubSequence;
}

function match(subSequenceObj, windowObj) {
  let result = false;
  for (let key in subSequenceObj) {
    if (subSequenceObj[key] > 0) {
      if (subSequenceObj[key] <= windowObj[key]) {
        result = true;
      } else return false;
    }
  }
  return result;
}
function editGeneObj(geneObjt, letter, operation) {
  if (operation === 1) {
    geneObjt[letter] = geneObjt[letter] + 1;
  } else geneObjt[letter] = geneObjt[letter] - 1;

  return geneObjt;
}

function steadyGene(gene) {
  const n = gene.length;
  let geneMainCountObj = createGeneCountObj(gene),
    subSqu_CurreStr = generateGeneCorrectinStrSubSequence(geneMainCountObj, n),
    subSequence = subSqu_CurreStr.subSequenceStr,
    subSequenceObj = createGeneCountObj(subSequence),
    searchWindow = subSequence.length;

  if (subSequence.length === 0) return 0;

  let i = 0,
    j = 0,
    windowObj = createGeneCountObj(gene[j]);
  for (j = 1; j < searchWindow; j++) {
    windowObj = editGeneObj(windowObj, gene[j], 1);
  }
  j--;

  while (searchWindow < gene.length) {
    if (
      windowObj.A + windowObj.c + windowObj.g + windowObj.T !==
      subSequence.length
    ) {
      windowObj = editGeneObj(windowObj, gene[j - 1], 1);
    }
    while (j < gene.length) {
      if (match(subSequenceObj, windowObj)) {
        return searchWindow;
      }
      j++;
      windowObj = editGeneObj(windowObj, gene[j], 1);
      windowObj = editGeneObj(windowObj, gene[i], -1);
      i++;
    }
    searchWindow++;
    // console.log(searchWindow);
  }

  return;
}
